import React from "react";
import { data } from "../data";

const ProductScreen = () => {
  const product = data.products.find((x) => x.id === props.match.params.id);
  return (
    <div className="row">
      <div className="col-2">
        <img src={product.image} alt={product.name} />
      </div>
      <div className="col-1"></div>
      <div className="col-1"></div>
    </div>
  );
};

export default ProductScreen;
